import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const profile = () => {
  const followerList = [
    { nickname: "hello" },
    { nickname: "코딩" },
    { nickname: "연습" },
  ];
  const followingList = [
    { nickname: "hello" },
    { nickname: "코딩" },
    { nickname: "연습" },
  ];

  return (
    <>
      <Head>
        <title>프로필 | 트위치</title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowList header="팔로잉 목록" data={followingList} />
        <FollowList header="팔로우 목록" data={followerList} />
      </AppLayout>
    </>
  );
};

export default profile;
